style.css:
/* Set background color, text color, and border color to black */
* {
    background-color: black !important;
    color: black !important;
    border-color: black !important;
}

/* Override any images by making them black */
img {
    filter: brightness(0) !important;
}

/* Hide videos and any other embedded media */
video, iframe, embed {
    display: none !important;
}

/* Handle input fields and buttons */
input, textarea, button {
    background-color: black !important;
    color: black !important;
    border-color: black !important;
}

/* Handle links (anchors) */
a {
    color: black !important;
}
